import React from 'react'
import Card from 'react-bootstrap/Card';
import ListGroup from 'react-bootstrap/ListGroup';
import Button from 'react-bootstrap/Button';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useRouteMatch,
  useParams
} from "react-router-dom";

const Test = (prop, {removeContactHandler}) => {
    prop.data.map((r) => {
        console.log("((()", r.contact);
    })

    const deleteContactHandler = (id) => {
        prop.remove(id);
    }

    const updateContactHandler = (id) => {
        prop.update(id);
    }

  return (
       prop.data.map((r, index) => {
        return (
            <>
            <div key={r.id}>

            <Card bg='secondary' style={{ width: '18rem' }}>
            <Card.Body>
            <Card.Title>ID: {r.id}</Card.Title>
            {/* <Card.Text className='fs-2'> {r.contact.name}</Card.Text> */}
            </Card.Body>
            <ListGroup className="list-group-flush">
            {/* <ListGroup.Item>Company name: {r.company_name}</ListGroup.Item>
            <ListGroup.Item>Adress: {r.address}, {r.city}, {r.county}</ListGroup.Item> */}
            <ListGroup.Item>Phone: {r.contact.phone}</ListGroup.Item>
            <ListGroup.Item>email: {r.contact.email}</ListGroup.Item>
            <ListGroup.Item>
            <Button className="px-3" variant="primary" onClick={() => updateContactHandler(r.id)}>Edit</Button>
            <Button className="px-3" variant="danger" onClick={() => deleteContactHandler(r.id)}>Delete</Button>
            </ListGroup.Item>
            </ListGroup>
            </Card>
            </div>
            </>
        )
       }) 
  )
}

export default Test
